**Rationale**

`extendModel` is an alias for `Restangular.addElementTransformer(route, false, fn);`, and `extendCollection` is an alias for `Restangular.addElementTransformer(route, true, fn);`. The function [`addElementTransformer`](https://github.com/mgonto/restangular#addelementtransformer) is generally use with the provider in the doc (`RestangularProvider.addElementTransformer`), and sometimes in the Service `Restangular.addElementTransformer`.

The current version of the typings allows the use of `addElementTransformer` in both `IProvider` and `IService`.  
We also need to be able to call extendModel and extendCollection in the `IProvider`. Since `IService extends IProvider`, this will not cause any regression.

[Relevant portion of Restangular code](https://github.com/mgonto/restangular/blob/master/src/restangular.js#L477):

```
object.extendCollection = function(route, fn) {
  return object.addElementTransformer(route, true, fn);
};

object.extendModel = function(route, fn) {
  return object.addElementTransformer(route, false, fn);
};
```

Also changed the return type, it returns the object itself, not void.

Following this comment: https://github.com/DefinitelyTyped/DefinitelyTyped/issues/16318#issuecomment-381933894

Currently react-native/index.d.ts don't use *real* React components (i.e `class ... extends React.Component`), instead it's a "hackish" solution, [example with `TextInput`](https://github.com/DefinitelyTyped/DefinitelyTyped/pull/25307/commits/51c34fa4eedf3d60487d0beb3d4aaa1e5e5d1521):
```TypeScript
export interface TextInputStatic extends NativeMethodsMixin, TimerMixin, React.ComponentClass<TextInputProperties> {
  // ...
}

// ...

export const TextInput: TextInputStatic;
export type TextInput = TextInputStatic;
```

Because of this you cannot write valid things like #16318 (I've added [a test](https://github.com/DefinitelyTyped/DefinitelyTyped/pull/25307/commits/51c34fa4eedf3d60487d0beb3d4aaa1e5e5d1521#diff-b7f9493068068c65a8ac15953df610f5) to ensure this works now)

Here the fix:
```TypeScript
type Constructor<T> = new(...args: any[]) => T;
declare class TextInputComponent extends React.Component<TextInputProperties> {}
declare const TextInputBase: Constructor<NativeMethodsMixin> & Constructor<TimerMixin> & typeof TextInputComponent;
export class TextInput extends TextInputBase {
 // ...
}
```

So I've fixed every React Native component. Each component I have fixed is done in its own commit (so I could `yarn test` every component and review things piece by piece) and since React Native exposes a lot of components, well you have many commits - nothing to be afraid of :)

The second part of this PR is about renaming *Properties to *Props.
Why? [React Native documentation](http://facebook.github.io/react-native/) uses exclusively the term Props (1) (like the whole React ecosystem and [react/index.d.ts](https://github.com/DefinitelyTyped/DefinitelyTyped/blob/master/types/react/index.d.ts)) so now the definition is in sync with the documentation.
I've also added `@deprecated` "redirections" so people can still use the old syntax *Properties, the idea is to remove them in the future.

I know this is a big PR, I've spent several hours on it to ensure nothing is broken.

(1) I've reported the only place where they use the term Properties instead of Props: https://github.com/facebook/react-native-website/pull/321
